import React from 'react';

const Navbar = () => {
    return (
        <div className="jumbotron jumbotron-fluid">
             <div className="container text-center">
                 <h1 className="display-4">DINOSAUR MEMORY GAME!</h1>
                <p className="lead">Click on any dinosaur to earn points, but don't click on any more than once.</p>
            </div>
        </div>
    )
}
export default Navbar;
